window.bookSummaryJSON = "<p>Love is in the air. With it, something much more sinister.</p> <p>When Dave's monthly visitor—the man who howls at the moon—stops visiting, Constance knows something has gone horribly wrong. But Dave seems to relish his newfound freedom from the curse. Still, something about him has changed and not for the better.</p> <p>Allie is forced to make her first shift without her father. When she's found the next morning beside a body, her wolf form becomes suspect number one. But did the teenage werewolf do it?</p> <p>The search for the true killer dredges up a secret from Dave's past. Something he's been hiding from Constance for a long long time.</p> <p>Magic and mayhem collide in this Paranormal Women's Fiction Mystery. For fans of enemies-to-lovers romance, cozy mysteries, and hilarious witchy magic.</p>"; 
